    def searchRange(self, nums, target):
        """
        :type nums: List[int]
        :type target: int
        :rtype: List[int]
        """

        def binary_search(nums, target, left):
            low = 0
            high = len(nums) - 1
            while low <= high:
                mid = (low + high) // 2
                if nums[mid] == target:
                    if left:
                        if mid == low or nums[mid - 1] < target:
                            return mid
                        high = mid - 1
                    else:
                        if mid == high or nums[mid + 1] > target:
                            return mid
                        low = mid + 1
                elif nums[mid] < target:
                    low = mid + 1
                else:
                    high = mid - 1
            return -1

        left_index = binary_search(nums, target, True)
        right_index = binary_search(nums, target, False)
        return [left_index, right_index]

