class Solution(object):
    def firstUniqChar(self, s):
        """
        :type s: str
        :rtype: int
        """

        ## 1. Create a hashmap with key as the character and value as the index
        ## 2. Iterate through the string and check if the character is already in the hashmap
        ## 3. If it is, then remove it from the hashmap and continue
        ## 4. If it is not, then add it to the hashmap and continue
        ## 5. Return the value of the first character in the hashmap

        ## Time Complexity: O(n)
        ## Space Complexity: O(n)

        hashmap = {}
        for i in range(len(s)):
            if s[i] in hashmap:
                hashmap.pop(s[i])
            else:
                hashmap[s[i]] = i

        if len(hashmap) == 0:
            return -1

        return hashmap[list(hashmap.keys())[0]]

