    def wordPattern(self, pattern, s):
        """
        :type pattern: str
        :type s: str
        :rtype: bool
        """

        # split the string into words
        words = s.split()

        # if the number of words is not equal to the number of letters in the pattern, return False
        if len(words) != len(pattern):
            return False

        # create a dictionary to store the mapping between letters and words
        mapping = {}

        # iterate through the pattern and words
        for letter, word in zip(pattern, words):
            # if the letter is already in the mapping, check if the word is the same as the previous word
            if letter in mapping:
                if mapping[letter] != word:
                    return False
            # if the letter is not in the mapping, add it with the word
            else:
                if word in mapping.values():
                    return False
                mapping[letter] = word

        # if all the letters are mapped correctly, return True
        return True

